;(function(jsPDFAPI) {
    var font =
        ''
    var callAddFont = function() {
        this.addFileToVFS('SFProDisplay-Heavy-bold.ttf', font)
        this.addFont(
            'SFProDisplay-Heavy-bold.ttf',
            'SFProDisplay-Heavy',
            'bold'
        )
    }
    jsPDFAPI.events.push(['addFonts', callAddFont])
})(jsPDF.API)
